description:
Dearest friends,
Light some candles, start the water kettle, rearrange your comfiest cushions, turn up the volume on your stereo and enjoy this lovely album with your missus/lass/boyfriend... Glen Hansard's first studio album is so full of emotions, stories about loss, love and life. Please make certain that you own the album and support the artist!

I got these files from a different source, thought I'd share 'em with you.

Give peace a chance! Ian...


